var tipuesearch = {"pages": [{'title': 'member', 'text': '成員: \n 40523113 \xa0 吳宜賢 \n 40623252 \xa0 李展齊 \n 40723101 \xa0 沈易萱 \n 40723103 \xa0 林晏瑩 \n 40723107 \xa0 王晨祐 \n 40723114 \xa0 杜永瀚 \n 40723119 \xa0 林哲緯 \n 40723122 \xa0 施東勝 \n 40723124 \xa0 徐敬倫 \n 40723125 \xa0 張詠全 \n 40723152 \xa0 陳俊任 \n 40723155 \xa0 吳明峰 \n \n', 'tags': '', 'url': 'member.html'}, {'title': 'Final Focus', 'text': '1.動靜態網頁維護 \n 2.Reveal簡報 \n 3.pelican網誌 \n 註:要協同編輯網誌，每位組員都要有一個獨立的Leo editor\xa0 \n', 'tags': '', 'url': 'Final Focus.html'}, {'title': 'week practice', 'text': 'week10-11 \n \n 以分組協同方式整理教科書內容: \n \n 2015- Space Modeling with SolidWorks and NX https://link.springer.com/book/10.1007/978-3-319-03862-9 \n 各組員負責將課程重點與零組件繪圖練習, 加上解說與操作過程影片, 放入分組倉儲中. \n 2008- The Engineering Design Revolution The Engineering Design Revolution \xa0(a.k.a. cad_history.pdf) \n 各組員負責編寫 Solidworks, NX, Inventor 與 Creo (Pro/E) 的開發緣起, 套件安裝與設定流程, 以及利用各套件執行零組件繪圖的相關差異與特點分析, 分別放入分組倉儲中. \n \n \n Github 分組倉儲如何 fork, 如何建立正向 pull requests, 如何反向 pull requests, 組長如何處理各組員的 pull requests 內容, 如何處理 content.htm, reveal 簡報以及 pelican 網誌 markdown 中的改版衝突. (含 \xa0 GitExtensions 導入 ) \n \n \n NX12 零組件繪圖與 NXOpen Python 檔案的建立與應用.  ( http://mde.tw/cad2019/content/Task2.html ) \n \n \n 各組員分別執行 V-rep 與 Webots Tutorial, 分別利用 Solvespace 與 NX 建立零組件轉入, 比較兩者差異  ( http://mde.tw/cad2019/content/Task3.html ) \n \n \n 分組執行 \xa0 http://mde.tw/cad2019/content/Project.html \xa0 期末專案 \n \n \n \n week12 \n \xa0 NX 零組件繪圖 \n 請根據 \xa0 http://mde.tw/cad2019/downloads/NX-12-for-Engineering-Design.pdf \xa0 的導引, 透過分組協同完成各章節內容閱讀與操作練習, 並將練習影片加上說明字幕, 以 校名+系名+課程名稱+分組任務名稱+學號作為標題 , 上傳 Youtube 後, 分別嵌入個人與分組網頁中. \n 使用 NX3 者可以參考 \xa0 http://mde.tw/cad2019/downloads/UG-NX3-Tutorial.pdf \n 目的在能使用 NX 建立 \xa0 http://mde.tw/cad2019/content/Task2.html \xa0 完成越野車零組件的設計與繪圖, 並利用 CAE 模組進行零件的應力分析. \n Webots 與 V-rep Tutorial \n 請各組員在第十三週之前完成: \n https://cyberbotics.com/doc/guide/tutorial-1-your-first-simulation-in-webots \n 與 \n http://www.coppeliarobotics.com/helpFiles/en/bubbleRobTutorial.htm \n 並將操作過程製作成帶字幕影片, 上傳 Youtube 後, 分別嵌入個人與分組網站, 且將心得與兩者的比較內容放在個人與分組網誌中. \n \n week13 \n 每週將分別就課程任務執行結果與心得, 在個人與分組 Reveal 中進行各週簡報, 以作為期末自評與互評成績評定之參考. \n', 'tags': '', 'url': 'week practice.html'}, {'title': 'week12網址與心得', 'text': '40523113 \xa0 吳宜賢 \n \n 40623252 \xa0 李展齊 \n 40723101 \xa0 沈易萱 \n 40723103 \xa0 林晏瑩 \n 網址: https://www.youtube.com/watch?v=tgTjdzZdQTk (NX12之操作) \n \n 心得: \n 對於剛接觸兩款軟體的新手而言， NX12 為接受度較高的高階套件， 模擬與加工程序與應力分析和繪製3D草圖為該套件之特色， 並且指令相對於簡潔明瞭，運用在繪製草圖或是物件分析的部分都做得相對周到，儘管模擬加工方面之限制比較多之外，整體操作上較為順手。 \n 另一方面 Webots 主要為3D模擬套件，實際使用物體去模擬移動位置，可變換出不同場景已供參考，在設定操作步驟方面相對繁瑣，而測試機器人與機械傳動件作動為該套件主要特性，也可 指定對象的圖形和物理屬性。 \n 註 : 圖形屬性包括對象的形狀，尺寸，位置和方向，顏色和紋理。 \n 兩者套件比較下，個人偏向使用NX操作，因操作明瞭標示明顯，各指令也會給予相對詳細的解說，是新手也能操作順手的軟體。 \n 40723107 \xa0 王晨祐 \n \n 心得 :\xa0 第一次使用nx12繪圖還有些不習慣，經過電子書的說明跟閱讀後才懂得如何約束草圖上的線，比起solvespace的操作nx12的內容更加複雜也擁有比較多的應用可以使用，例如模擬與加工程序與應力分析這些功能可以使用，比起solvespace 跟 inventor這些繪圖程式，nx12的功能雖然比較繁多相反的需要更多時間去摸索跟熟悉。 \n 40723114 \xa0 杜永瀚 \n https://www.youtube.com/watch?v=LPlDoJRslU0 \n \n 心得: \n 在使用NX12的時候,一開始很不習慣,因為NX12為高階cad軟體,所以花了一些時間摸索,用完NX12發現它的功能很強大也很多,但操作起來也變得相當複雜,之前常用SOLID WORK,發現SOLID WORK用起來是比NX12好上手,但NX12功能較多,也較廣泛. \n 40723119 \xa0 林哲緯 \n 40723122 \xa0 施東勝 \n 40723124 \xa0 徐敬倫 \n 40723125 \xa0 張詠全 \n \n 心得:第一次使用NX12繪製，還不習慣只能做到簡單的特徵，在這本 NX 12 for Engineering Design 原文書中可以學到很多進階的操作，目前我只讀到第2章就能繪製成這樣，在讀下去就不得了! \n 40723152 \xa0 陳俊任 \n 40723155 \xa0 吳明峰', 'tags': '', 'url': 'week12網址與心得.html'}, {'title': 'week13', 'text': '第13週-Solvespace 與 NX12 參數繪圖與 V-rep 結合應用 \n 重點筆記: 講解NX3與NX12之間特性、差異 \n NX3 使用輸出VRML[選VRML2.0，轉入Webots(副檔名.wrl)] 並勾選選項  1.output lights  2.output matenals  3.recursive multi file 註 :  1.imput VRML為Webots打開之檔案類型  2.solvespace無法轉成wrl檔  3.wrl檔為文字檔   NX12 重要檔案  1.NXASSEMBLY(作用為轉檔)=IGES也是轉檔  2.NXBIN  3.UGII 註:  1.Journal=畫圖中並同時儲存   比較差異 \n NX3 =較陽春，但簡便，可執行放在UGII檔裡 \n NX12 =規格、功能性相對齊全，但為了配合Windows 7之後的升級改版，直接將大部分檔案放在NXBIN裡，不過有些重要檔案仍儲存在UGII裡。 \n HOW TO\xa0 將NX12程式語言改成Python \n 改寫位置之操作順序: File>Preferences>User interface>Tools \n 原先Journal language中將Visual Basic選項改為Python選項 \n 目的: 主要方面日後藉由程式去操作NX12 \n', 'tags': '', 'url': 'week13.html'}, {'title': 'week14', 'text': '任務 : \n 同步 啟動跨組自評與互評機制 , 並針對課程內容所要求的任務要項逐一查驗各組員學習成效, 希望在鼓勵組員公開倉儲內容與教學影片互相學習之餘, 也能達到公平計分的目的，同時也強制性規定需作筆記。 \n 在第十四週也逐步介紹NX、Solvespace、Webots的執行與互動 \n Q.如何用SciTe執行Python，與NX、Solvespace、Webots互動 \n A : 程式由外部控制虛擬、實體(大略贅述，詳情敘述只紀錄關鍵字) \n 片刻紀錄 : \n 1 .關鍵字:nx run journal=用python執行，但沒跑出原始碼。 \n 2 .需放Download裡(只是demo)=可直接給路徑<path:path>名稱(yrl.學號)，使學號在路徑連結。 \n 3 .cmsimde@...=為release轉出版本，會改變數字。 \n', 'tags': '', 'url': 'week14.html'}, {'title': 'week15', 'text': '\n \n \n \n', 'tags': '', 'url': 'week15.html'}, {'title': 'Introduction', 'text': '一 \n 編寫1- solidworks(中階) \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa02-Nx (高階) \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa03-inventor(中階) \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa04-Creo(proe)=oneshape 的開發起源(高階)-已被併購 \n \xa0 \xa0 \xa0 \xa0  \xa0 \xa0註 :中階曲面不強 \n 安裝套件 設定流程 分析各套件零組件差異與特點，放入倉儲。 \n 市占比例: \n solidworks(25%)沒雲端 \n nx(不超過3%) \n inventor(35%) \n creo(pro/e)(35%) \n 二 \n 倉儲如何fork html reveal pelican markdown 中改版衝突 \n 註 :組員需fork 及正向pull request (組長為管理者) \n Week Practice \n', 'tags': '', 'url': 'Introduction.html'}, {'title': '編寫軟體介紹', 'text': 'NX特點 \n •\xa0 \xa0 3D 零件建模使用協力廠商的 CAD 模型。 利用同步建模技術，可直接編輯零件模型，並準備讓零件進入NC編程 。 \n • \xa0 NX 提供建立 NC 操作之前快速進行分析的能力。 \n • \xa0 建模、組立件與製圖-NX 提供了 CAD 功能組合。這些功能已納入 NX CAM 之中，可供用來建立零件、坯件形狀、夾治具或工具機模型以進行模擬。 \n • 模擬技術融合到結構、動作、熱力、流體、多重物理與最佳化解決方案 \n 註 :1-繪圖過程中如有需修改，可直接改寫程式碼，不須改圖。 \n \xa0 \xa0 \xa0 \xa02-產生應力分析，並分析最佳化。 \n CAD \xa0 \n • 製造流程從零件設計資料輸入開始，通常是 3D CAD 模型，在某些情況下也可能是 2D圖面。通常會需要用到 3D CAD 軟體以準備或調整零件設計模型。 \n \n CAD 應用程式也可以用來設計與組合夾治具。NX CAM 套件內含完全整合的 CAD 功能，全部納入同一套 NX 系統之中。 CAM \xa0 \n ======= \n NX特點 \n • \xa0 \xa0 3D 零件建模使用協力廠商的 CAD 模型。 利用同步建模技術，可直接編輯零件模型，並準備讓零件進入NC編程 。 \n • \xa0 NX 提供建立 NC 操作之前快速進行分析的能力。 \n • \xa0 建模、組立件與製圖-NX 提供了 CAD 功能組合。這些功能已納入 NX CAM 之中，可供用來建立零件、坯件形狀、夾治具或工具機模型以進行模擬。 \n • 模擬技術融合到結構、動作、熱力、流體、多重物理與最佳化解決方案 \n 註 :1-繪圖過程中如有需修改，可直接改寫程式碼，不須改圖。 \n \xa0 \xa0 \xa0 \xa02-產生應力分析，並分析最佳化。 \n CAD \xa0 \n • 製造流程從零件設計資料輸入開始，通常是 3D CAD 模型，在某些情況下也可能是 2D圖面。通常會需要用到 3D CAD 軟體以準備或調整零件設計模型。 \n \n CAD 應用程式也可以用來設計與組合夾治具。NX CAM 套件內含完全整合的 CAD 功能，全部納入同一套 NX 系統之中。 CAM \xa0 \n • NX CAM 包含 NC 編程、後處理及工具機模擬。 \n \n • 套件Siemens 為進階工具機控制器技術及驅動設備領域的公認領導廠商。 提供 CAD-CAM-CNC 流程鏈支援，讓您最新的工具機投資價值發揮到極致。 \n \n 電子書: \n \n https://docs.plm.automation.siemens.com/docs/nx/12.0.1/en_US/release_notes.pdf \n \n 1. SMP \n Symmetric Multiprocessing (SMP) is supported in NX mostly via Parasolid, although a small number \n \n 翻譯:\n NX主要通過Parasolid支持對稱多處理（SMP），儘管數量很少 2. 目錄 The new NX runtime directory does not contain all binaries and executables. Only the most frequently used files from the following directories have been moved: •  UGII •  UGMANAGER •  STEP203UG •  STEP214UG •  PVTRANS •  MACH Other files will also be moved over time. However, some applications, such as NX Nastran, will not be moved. \n=======\n 1.SMP \n Symmetric Multiprocessing (SMP) is supported in NX mostly via Parasolid, although a small number \n \n 翻譯:\n NX主要通過Parasolid支持對稱多處理（SMP），儘管數量很少 2.目錄 The new NX runtime directory does not contain all binaries and executables. Only the most frequently used files from the following directories have been moved: •  UGII •  UGMANAGER •  STEP203UG •  STEP214UG •  PVTRANS •  MACH Other files will also be moved over time. However, some applications, such as NX Nastran, will not be moved. \n 翻譯: \n 新的NX運行時目錄不包含所有二進製文件和可執行文件。 僅移動了以下目錄中最常用的文件：\n • UGII\n • UGMANAGER\n • STEP203UG\n • STEP214UG\n • PVTRANS\n • 馬赫\n其他文件也會隨著時間的推移而移動。但是，某些應用程序（例如NX Nastran）將\n不動。 \n \n 3. 版本 Historically, the NX product release has included the refile utility, which was created many years ago This utility was never mandatory when performing NX upgrades. NX product enhancements and improvements that are delivered and available in the current NX release make NX upgrades much faster and easier, so the refile utility is now obsolete.  the refile utility is retired starting in NX 12.0.1. The documentation for the utility has already been removed in NX 12. In place of the refile utility, standalone utilities will be introduced that incorporate non-version-up related options and future NX batch processes. Teamcenter names and values of properties localized \n 3.版本 Historically, the NX product release has included the refile utility, which was created many years ago This utility was never mandatory when performing NX upgrades. NX product enhancements and improvements that are delivered and available in the current NX release make NX upgrades much faster and easier, so the refile utility is now obsolete.  the refile utility is retired starting in NX 12.0.1. The documentation for the utility has already been removed in NX 12. In place of the refile utility, standalone utilities will be introduced that incorporate non-version-up related options and future NX batch processes. Teamcenter names and values of properties localized \n • there is now the capability to have the names and values of properties translated and displayed in multiple languages.  \n • the Part Family template spreadsheet \n \xa0 \n • New Item \n • Save \n • Import, and component properties dialog boxes. \n \n 翻譯: \n 從歷史上看，NX產品版本包含了refile實用程序，該實用程序是多年以前創建的， 執行NX升級時，該實用程序從不是必需的。  當前NX中提供和可用的NX產品增強和改進 發布版本使NX的升級變得更快，更容易，因此refile實用程序現在已過時。 \n從NX 12.0.1開始，重新歸檔實用程序已停用。該實用程序的文檔已經在NX 12中已刪除。\n代替refile實用程序，將引入合併非版本升級的獨立實用程序，其中包含與非版\n本相關選項和將來的NX批處理過程。\n Teamcenter名稱和屬性值已本地化 \n • 現在可以轉換屬性的名稱和值，並 以多種語言顯示。 \n • 零件族模板電子表格 \n • 新選項 \n • 保存 \n • “導入”和“組件屬性”對話框。 4. 尺寸 When you run the ug_convert_part tool to convert an NX 12 part from mm to inch, the settings in the Unit Manager dialog box do not display the converted units. This is as intended. 翻譯: \n 當運行ug_convert_part工具將NX 12零件從毫米轉換為英寸時，“單位管理器”對話框中的設置不會顯示轉換後的單位。 這是預期的。 Solid Work特點 1. 介面 -根據工作需求，自行定義SOLIDWORKS環境 2. 繪圖 - 2D設計會自動與3D模型連動，當修改3D模型時，2D的設計草圖就會自動更新 \n • “導入”和“組件屬性”對話框。 4.尺寸 When you run the ug_convert_part tool to convert an NX 12 part from mm to inch, the settings in the Unit Manager dialog box do not display the converted units. This is as intended. 翻譯: \n 當運行ug_convert_part工具將NX 12零件從毫米轉換為英寸時，“單位管理器”對話框中的設置不會顯示轉換後的單位。 這是預期的。 Solid Work特點 1. 介面 -根據工作需求，自行定義SOLIDWORKS環境 2. 繪圖 - 2D設計會自動與3D模型連動，當修改3D模型時，2D的設計草圖就會自動更新 \n 自動創建設計的材料清單（BOM）和註解，包括尺寸和公差專家工具。 \n 3. 排除故障 - 設計發生衝突，SOLIDWORKS SketchXpert功能，會協助自動進行問題辨識和故障排除 可大幅減少設計誤差導致的重工和時間、成本上的浪費 4. 曲線 之圖稿與元件設計比其他軟件還好用 5. 成本估算 - 擁有自動成本計算工具，能針對設計的零件製造成本做出估算，可以輸入特定的製造成本和數據，如材料、人工、機器運行速度和損耗，以及安裝成本 \n \n \n \n \n \n \n \xa0 \n 附註 ： (1) SOLIDWORKS不支援Windows家用版 (2) 建議使用Microsoft Windows、Office和IE瀏覽器的最新版本 (3) 不支援Microsoft Office 即點即用(Click-To-Run)功能 \n 附註： (1) SOLIDWORKS不支援Windows家用版 (2) 建議使用Microsoft Windows、Office和IE瀏覽器的最新版本 (3) 不支援Microsoft Office 即點即用(Click-To-Run)功能 \n \n', 'tags': '', 'url': '編寫軟體介紹.html'}, {'title': 'Introduction Pull request', 'text': '正反向拉回差別在於資料傳遞的方向。 \n 假設是正向拉回，是 組員(無權限)將資料推送回組別倉儲後給組長(管理員)確認資料後使其合併 。 \n 反之，反向拉回是 管理者將權限給予組員讓他們擁有可merge的權力 ，不過在這邊很常因為組員推送問題產生衝突，並且解決方式較為繁瑣，因此這學期並不推薦使用反向拉回的方式管理組別倉儲。 \n 以下為正向拉回範例: \n step1 \n 先點入自己分組倉儲之pull request，出現畫面為(圖1) \n \n 這時出現merge問題，但仍可以pull request，並按下Create \n pull request之按鍵 \n step2 確認完再按下標題與傳遞內容後再按下 Create  pull request \n step3 出現畫面代表衝突檔案，需由管理員(組長)確認資料並合併之後處理衝突版面並再次推送， 藉此merge完成 \n \n \n', 'tags': '', 'url': 'Introduction Pull request.html'}, {'title': 'NX 12 for Engineering Design', 'text': 'http://mde.tw/cad2019/downloads/NX-12-for-Engineering-Design.pdf \n 前言 \n \n NX是Siemens PLM Software提供的世界上最先進且緊密集成的CAD / CAM / CAE產品開發解決方案之一。 NX涵蓋了整個產品開發範圍，可為各種規模的企業提供巨大的價值。 它簡化了複雜的產品開發，從而加快了將產品推向市場的過程 \n 第1章簡介 \n 現代製造環境可以通過提供的種類越來越多的產品，小批量和更高的質量在提高全球競爭的背景下的模式為特徵。除非行業以更高的質量，更低的成本和更短的交付時間推出新產品，否則它們就無法在全球競爭中生存。國際競爭激烈，技術工人的供應減少。 隨著計算能力的巨大變化和用於設計和生產的軟件工具的廣泛可用性，現在工程師都使用計算機輔助設計（CAD），計算機輔助製造（CAM）和計算機輔助工程（CAE）系統來自動化設計和生產過程。現在這些技術每天都用於各種不同的工程任務。 以下是產品實現過程中如何使用CAD，CAM和CAE技術的簡要說明。 \n CAD / CAM / CAE的定義 \n • 計算機輔助設計– CAD \n \xa0 \xa0 \xa0 CAD技術是涉及使用計算機系統協助創建，修改，分析和優化設計。 \n • 計算機輔助製造– CAM \n \xa0 \xa0 CAM技術涉及到計算機系統規劃管理，並與工廠的生產資源的控制通過計算機接口的製造業務。 \n • 計算機輔助工程– CAE \xa0 \xa0 CAE技術使用計算機系統來分析CAD創建的產品的功能，從而使設計人員可以模擬和研究產品的性能，從而可以優化和優化設計。 \n 這本原文書是針對有興趣學習如何使用NX 12設計機械零件和組件的學生和工程師編寫的。學習使用NX 12對於學習如何使用其他CAD系統（例如PRO-E和CATIA）也將非常有價值。\xa0 \n 第2章 介紹了從開始會話到熟悉NX的NX 12基本知識。通過練習基本功能（如打印，保存和退出）來佈局12。它還給出了簡短的描述坐標系圖層，各種工具箱和其他重要命令在後面的章節中使用。 \n 第3章 介紹了素描的概念。它描述瞭如何創建草圖並給出幾何和尺寸約束。從今天開始，本章非常重要組件的幾何形狀非常複雜，僅憑基本特徵很難建模。 \n 第4章 開始零件的實際設計和建模。它描述了不同的功能例如參考特徵，掃描特徵和原始特徵，以及如何使用這些特徵創建設計。對特徵執行各種特徵操作。 \n 第5章 中學習如何從零件模型創建工程圖。在本章中，我們通過添加視圖，標註零件圖紙尺寸來演示如何創建圖紙，以及修改圖形中的各種屬性，例如文本大小，箭頭大小和公差。 \n 第6章 介紹了裝配建模的概念及其術語。它描述了Top-向下建模和自下而上建模。我們將使用自下而上的模型進行組裝組件變成產品。 \n 第7章 介紹了自由格式建模。曲線和平滑曲面的建模方法將被演示。 \n 第8章 概述了NX 12中提供的Design Simulations的簡要介紹。 \n 第9章 將是在製造中實施設計模型的實時經驗加工環境。本章介紹工具的生成，驗證和模擬創建CNC（計算機數字代碼）以從多軸生產設計零件的路徑甚至先進的CNC機器。每章中使用的示例和練習問題都經過精心設計，以使它們最終得以應用組裝在本章中。由於這項獨特的功能，您應該保存所有的模型在每一章中都有創建。 \n 資料連結 \n http://mde.tw/cad2019/content/NX.html \n<<<<<<< HEAD\n', 'tags': '', 'url': 'NX 12 for Engineering Design.html'}, {'title': 'Deal with problems', 'text': 'Q: 當倉儲git pull+分組倉儲網址後發現無法正常開啟近端 \n A:將倉儲start鍵放入文字編輯器並且查看，發現有多一個分號（：），將分號刪除並儲存後即可進入近端 \n BEFORE \n \n \n AFTER \n \n \n Reason:因為有人倉儲本身是壞的，因此當其他人gitpull時會讓他人倉儲錯誤，造成倉儲近端損毀。 \n \n \n Q: 為什麼用了git pull 分組倉儲網址完無法正確連結完成並進行改版 \n A:先將倉儲中最新版本反向拉回（左為本身，右為管理者）並且git commit git push上去後再次進入近端即可改為最新版本進行改版推送 \n EX: \n \n Reason:有可能因為尚未推送回分組倉儲使最新版本與自身隨身碟中可攜系統舊版沒有連結成功，因此git pull 分組倉儲網址完進入近端依然還是舊版 \n \n \n Q 為什麼管理員merge完會使倉儲爆掉，產生舊版與新版衝突(如下) \n \n A: \n 在這次解決問題中，由於近端未有衝突問題並且使用正常，進入近端按下轉靜態後再次git push上傳即可恢復網頁 \n RESEASON (原因 ): \n 有可能是因為其中一位倉儲推送上去使用到git pull的緣故使得新舊版產生合併問題，造成有兩個版面的緣由 \n \n<<<<<<< HEAD\n<<<<<<< HEAD\n=======\n>>>>>>> f07ec51da8d9884493ffdfe7f3272c81c6e7809c\n Q 進入近端卻直接跳下一行並沒有做任何作動 \n EX: \n D:\\87\\cmsimde>python wsgi.py \n D:\\87\\cmsimde> \n A: \n 將啟動程式按鍵(start_mdecourse.bat)拖曳到SciTe裡，並將裡面其中一行程式多餘的開頭程式 %path% 刪除，重新啟動(按下Stop.bat)即可恢復正常。 \n \n 如上圖所示，但前面的%path%以更改完畢，因此範例中的程式是已經改善完畢的。 \n RESEASON(原因 ): \n 因為%path%為進入近端之bug，需查看是否修正完畢。', 'tags': '', 'url': 'Deal with problems.html'}, {'title': 'webots', 'text': '\n 參考資料 http://mde.tw/cad2019/content/Webots.html \n webots:有五種程式可運用，ex:C、C++、Python、Java、MATLAB，為零組件組合軟件。 \n 註解 :建立模型孔需有間隙(SOLVESPACE)，因轉出零件檔案(零件件數有多少，就轉多少次)，再轉入WEBOTS。 \n 目前因WEBOTS還是商用化，因此檔案仍停留在1999年。', 'tags': '', 'url': 'webots.html'}, {'title': 'webots安裝', 'text': '下載位置: Webots_2019b_rev1.7z \n 1.新增啟動器 \n \n 2. 執行路徑設定 \n set path_webots=%Disk%:\\Webots_2019b_rev1\\msys64\\mingw64\\bin;%Disk%:\\Webots_2019b_rev1\\msys64\\usr\\bin \n %path_webots%; \n \n \n 3.設定抓取的檔案 \n start webots.exe%*\n \n \n 4.將檔案丟入啟動器底下 \n \n', 'tags': '', 'url': 'webots安裝.html'}]};